import React, { useState, useEffect } from 'react';
import './style.css'

const UserProductsPage = (props) => {
    const [userProductsList, setUserProductsList] = useState([])
    const [rows, setRows] = useState([])
    async function getProducts() {
        await fetch(`http://127.0.0.1:8000/api/products/`)
            .then(response => response.json())
            .then(response => {
                const getObjects = response.find(obj => obj.added === true)
                setUserProductsList(getObjects)
                // dataFilter.map((row) => <ProductRow {...row} />));
            })
    }
    useEffect(() => {
        getProducts()
    }, [])

    useEffect(() => {
        if (Object.keys(userProductsList).length > 0) {
            console.log('hello its time')
            setRows(userProductsList.map((row) => <ProductRow {...row} />))
        }
    }, [userProductsList])

    console.log(userProductsList.length, userProductsList)

    function findCategoryName(id) {
        const object = props.categoriesData.find(obj => obj.id === id)
        const value = object ? object.name : null;
        return value
    }
    const ProductRow = ({ title, price, category }: { title: string, price: number, category: number, id: string }) => (
        <tr className='text-center'>
            <th>{title}</th>
            <th>$ {price}</th>
            <th>{findCategoryName(category)}</th>
        </tr>
    );
    return (
        <div>
            <h1 className="m-5 text-4xl">User Products Page</h1>
            <table className='m-5 min-w-[90%]'>
                <thead>
                    <tr>
                        <th>Product</th>
                        <th>Average $</th>
                        <th>Category</th>
                        <th>Add</th>
                    </tr>
                </thead>
                <tbody>
                    {rows}
                </tbody>
            </table>
        </div>
    )
}

export default UserProductsPage
